import * as actionsType from "./const/actionsType"

export const actGetStudents = () => {
    return {
        type: actionsType.GET_STUDENTS
    }
}

export const actSuccess = (data) => {
    return {
        type: actionsType.SUCCESS,
        payload: data
    }   
}

export const actToggle = (value) => {
    console.log(value);
    return {
        type: "CONTROL/TOGGLE",
        paload: value
    }
}
